// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

pragma experimental ABIEncoderV2; // Enable experimental ABIEncoderV2 feature

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/token/ERC20/ERC20.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/AccessControl.sol";

contract Geologix is ERC20 {

    address public owner;
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
    constructor() ERC20("RToken", "RT") {       
        owner = msg.sender;
    }   
    enum DeviceState { Created, InZone, OutZone, Completed}
    // employee data
    struct Employee {
        uint id;
        string name;
        address public_address;
    }

    //employer data
    struct Employer {
        uint id;
        string name;
        address public_address;
    }

    struct ComplianceCounts {
        uint256 complianceCount;
        uint256 nonComplianceCount;
    }

    struct GeologixPaymentContract {
        uint contractId;
        uint latitude;
        uint longitude;
        uint radius;
        uint startTime;
        uint endTime;
        uint rewardAmount;
        address employee;
        address empolyer;
        bool isActive;
        // uint256 complianceCount;
        // uint256 nonComplianceCount;
        ComplianceCounts counts;
        DeviceState deviceState;
    }


    mapping(address => Employee) public employees;
    uint public Employeecount;

    mapping(address => Employer) public employers;
    uint public Employercount;


    mapping(uint => GeologixPaymentContract) public smartContracts;
    uint public ContractCount; 


    function addEmployer (string memory _name , address user_address) public {
        Employercount ++;
        employers[user_address] = Employer(Employercount, _name, user_address);
    }

    function addEmployee (string memory _name , address user_address) public {
        Employeecount ++;
        employees[user_address] = Employee(Employeecount, _name, user_address);
    }

    function getContract(uint _contractId) public view returns (uint contractId, uint complianceCount, uint nonComplianceCount, DeviceState deviceState) {
        GeologixPaymentContract memory curContract = smartContracts[_contractId];
        return (curContract.contractId, curContract.counts.complianceCount, curContract.counts.nonComplianceCount, curContract.deviceState);
    }


    function createSmartContract (
        uint256 _latitude,
        uint256 _longitude,
        uint256 _radius,
        uint256 _startTime,
        uint256 _endTime,
        uint256 _rewardAmount,
        address _employee,
        address _employer

    ) public {

         ComplianceCounts memory counts = ComplianceCounts({
            complianceCount: 0,
            nonComplianceCount: 0
        });


         ContractCount ++;
            smartContracts[ContractCount] = GeologixPaymentContract(
            ContractCount,
            _latitude,
            _longitude,
            _radius,
            _startTime,
            _endTime,
            _rewardAmount,
            _employee,
            _employer,
            true,
            counts,
            DeviceState.Created
        );
    }

    function payEmployee(uint contractId) public {
        transfer(smartContracts[contractId].employee, smartContracts[contractId].rewardAmount); // Transfer tokens from the contract's address
    }

    function updateEmployeeStatus(uint256 _latitude, uint256 _longitude, uint contractId, uint currentTime) public {
    // Retrieve the smart contract associated with the caller
    GeologixPaymentContract storage contractInfo = smartContracts[contractId];

    // Check if the contract is active
    require(contractInfo.isActive, "Contract is not active");

    // uint currentTime = 3;

    // Check if the current time is after the start time
    require(currentTime > contractInfo.startTime, "Current time is before the start time");

    // Check if the current time is before the end time
    if (currentTime < contractInfo.endTime) {
        // Check if the employee's location is within the specified range
        if (isInZone(_latitude, _longitude, contractInfo.latitude, contractInfo.longitude, contractInfo.radius)) {
            // Increase compliance count and update device state
            contractInfo.counts.complianceCount++;
            contractInfo.deviceState = DeviceState.InZone;
        } else {
            // Increase non-compliance count and update device state
            contractInfo.counts.nonComplianceCount++;
            contractInfo.deviceState = DeviceState.OutZone;
        }
    } else {
        // End time has passed, trigger payment to employee and deactivate contract
        payEmployee(contractId);
        contractInfo.isActive = false;
        contractInfo.deviceState = DeviceState.Completed;
    }
        }

        // Function to check if a given location is within the specified range
        function isInZone(
            uint256 _latitude1,
            uint256 _longitude1,
            uint256 _latitude2,
            uint256 _longitude2,
            uint256 _radius
        ) internal pure returns (bool) {
            // Convert latitude and longitude to radians
            // uint256 lat1Rad = _latitude1 * 3.14159265358979323846 / 180;
            // uint256 lat2Rad = _latitude2 * 3.14159265358979323846 / 180;
            // uint256 lon1Rad = _longitude1 * 3.14159265358979323846 / 180;
            // uint256 lon2Rad = _longitude2 * 3.14159265358979323846 / 180;

            // Calculate the differences
            uint256 latDiff = _latitude1 - _latitude2;
            uint256 lonDiff = _longitude1 - _longitude2;

            // Calculate the distance using Haversine formula
            //  uint256 a = lat1Rad;

            // uint256 a = (sin(latDiff / 2) ** 2) + (cos(lat1Rad) * cos(lat2Rad) * (sin(lonDiff / 2) ** 2));
            // uint256 c = 2 * atan2(sqrt(a), sqrt(1 - a));
            // uint256 distance = 6371000 * c; // Earth radius * c

            uint256 distance = latDiff + lonDiff;

            // Check if the distance is within the specified radius
            return distance <= _radius;
        }

}

